import React from "react";

class Navbar extends React.Component {
  render() {
    return (
      <nav className="navbar is-dark">
        <div className="navbar-end">
          <div className="navbar-item">
            <div className="field is-grouped">
              <p className="control">
                <a href="#">spreed</a>
              </p>
            </div>

            <a href="#">text</a>
          </div>
        </div>
      </nav>
    );
  }
}

export default Navbar;
